"""Tuner with Simulate Anneal algorithm"""

import numpy as np
import multiprocessing
from .tuner import Tuner
from .model_based_tuner import knob2point, point2knob
from ..measure import MeasureInput, create_measure_batch

from ..env import GLOBAL_SCOPE
from .sa_model_optimizer import random_walk
import logging
logger = logging.getLogger('autotvm')

class HCTuner(Tuner):
    """
    """

    def __init__(self, task, early_stop = 1e9):
        super(HCTuner, self).__init__(task)

        self.space = task.config_space
        self.dims = [len(x) for x in self.space.space_map.values()]

        self.visited = set([])
        
        self.parallel_size = multiprocessing.cpu_count()
        #self.parallel_size=6
        self.points = [] # 初始的是初始的数据
        self.scores = [] # 存放的是初始的结果
        self.new_points = [] # 存放的是修改后的数据
        self.new_scores = [] # 存放的修改后的结果
        self.trial_pt = 0
        self.best_iter = 0 
        self.lens = []
        self.before_iters = []
        self.best_iters = []
    

        for _ in range(self.parallel_size):
            tmp_population = point2knob(np.random.randint(len(self.space)), self.dims)
            while knob2point(tmp_population, self.dims) in self.visited:
                tmp_population = point2knob(np.random.randint(len(self.space)), self.dims)
            self.points.append(knob2point(tmp_population, self.dims))
            self.visited.add(knob2point(tmp_population, self.dims))



    def tune(self, n_trial, measure_option, early_stopping = None, callbacks = ()):
        measure_batch = create_measure_batch(self.task, measure_option)
        n_parallel = getattr(measure_batch, 'n_parallel', 1)
        early_stopping = early_stopping or 1e9
        self.n_trial = n_trial
        self.early_stopping = early_stopping
        old_level = logger.level
        GLOBAL_SCOPE.in_tuning = True 
        i = error_ct = 0
        points = []
        first = min(n_parallel, n_trial)
        for k in range(first):
            points.append(self.space.get(self.points[k]))
        inputs = [MeasureInput(self.task.target, self.task, point) for point in points]
        results = measure_batch(inputs)
        file = "hc"
        for k, (inp, res) in enumerate(zip(inputs, results)):
            config = inp.config
            print("==================================")
            print(config.index)
            with open(file, 'a+') as f:
                f.write(str(config))
                f.write('\n') 
                f.write(str(res))
                f.write('\n') 
            if res.error_no == 0:
                flops = inp.task.flop / np.mean(res.costs)
                error_ct = 0
            else:
                flops = 0
                error_ct += 1 
            self.scores.append(flops)  # 当前的成绩
            if flops > self.best_flops:
                self.best_flops = flops
                self.best_config = config
                self.best_measure_pair = (inp, res)
                # self.best_iter = i + k
            self.before_iters.append(0)
            logger.debug("No: %d\tGFLOPS: %.2f/%.2f\tresult: %s\t%s",
                             i + k + 1, flops / 1e9, self.best_flops / 1e9,
                             res, config)
        for callback in callbacks:
            callback(self, inputs, results)
        print("初始成绩 self.scores : ", self.scores)
        i = i + len(results)
        
        iter = 1
        self.best_iters = np.zeros_like(self.before_iters)
        while i < n_trial:
            print("i = ", i)
            if not self.has_next():
                break
            # configs = self.next_batch(min(n_parallel, n_trial - i))
            configs = self.next_batch(iter-1)
            best_flop = 0
            print("len(configs) :", len(configs))

            inputs = [MeasureInput(self.task.target, self.task, config) for config in configs]
            results = measure_batch(inputs)
            if (iter - 1) % self.parallel_size == 0:
                self.new_scores = np.zeros_like(self.scores)
                self.news = np.zeros_like(self.points)
            print("初始随机 self.new_scores : ",self.new_scores)
            for k, (inp, res) in enumerate(zip(inputs, results)):
                config = inp.config
                with open(file, 'a+') as f:
                    f.write(str(config))
                    f.write('\n')
                    f.write(str(res))
                    f.write('\n') 
                if res.error_no == 0:
                    flops = inp.task.flop / np.mean(res.costs)
                    error_ct = 0
                else:
                    flops = 0
                    error_ct += 1 
                # new_scores.append(flops)
                if flops > best_flop:
                    self.new_scores[(iter - 1) % self.parallel_size] = flops
                    self.news[(iter - 1) % self.parallel_size] = config.index
                    best_flop = flops
                    if flops > self.best_flops:
                        self.best_flops = flops
                        self.best_config = config
                        self.best_measure_pair = (inp, res)
                        self.best_iter = i + k  # 
                    print("self.scores :", self.new_scores)
                # logger.debug("No: %d\tGFLOPS: %.2f/%.2f\tresult: %s\t%s",
                #              i + k + 1, flops / 1e9, self.best_flops / 1e9,
                #              res, config)
            print("self.scores : ", self.new_scores)
            if iter % self.parallel_size == 0:       
                print("ok")  
                print("========================")
                print(self.before_iters)
                print(self.best_iters)   
                for k, point in enumerate(self.new_scores):
                    if self.scores[k] < self.new_scores[k]:
                        self.best_iters[k] = iter
                        print("iter :",iter)
                        print(self.best_iters)
                        self.points[k] = self.news[k]  # 下一个batch按照这个的进行修改
                        self.scores[k] = self.new_scores[k]
                    print(self.points)
                stop_iters = 0
                print("self.before_iters :", self.before_iters)
                print("self.best_iters :", self.best_iters)
                for k in range(len(self.best_iters)):
                    if self.best_iters[k] == self.before_iters[k]:
                        stop_iters += 1
                        tmp_population = point2knob(np.random.randint(len(self.space)), self.dims)
                        while knob2point(tmp_population, self.dims) in self.visited:
                            tmp_population = point2knob(np.random.randint(len(self.space)), self.dims)
                        self.points[k] = knob2point(tmp_population, self.dims)
                        self.visited.add(knob2point(tmp_population, self.dims))
                    self.before_iters[k] = self.best_iters[k]
                if stop_iters == len(self.best_iters):
                    logger.debug("Early stopped. Best iter: ", self.best_iters)
                    break

                    
                    # else:
                    #     if self.best_config is not None:
                    #         point = np.random.randint(len(self.dims))
                    #         tmp_points = point2knob(self.best_config.index, self.dims)[:point] + point2knob(self.new_points[k], self.dims)[point:]
                    #         self.new_points[k] = knob2point(tmp_points, self.dims)

            i += len(results)
            iter += 1
            # self.ttl = min(early_stopping + self.best_iter, n_trial) - i # ???
            # predict_time, fit_time = 
            self.update(inputs, results)
            # self.predict_time += predict_time
            # self.fit_time += fit_time
            for callback in callbacks:
                callback(self, inputs, results)
            # if i >= self.best_iter + 50:
            #     for t, tmp_gene in enumerate(self.points):
            #         tmps = point2knob(tmp_gene, self.dims)
            #         for j, dim in enumerate(self.dims):
            #             tmps[j] = np.random.randint(dim)
                        
            #         while knob2point(tmps, self.dims) in self.visited:
            #             j = np.random.randint(len(self.dims))
            #             tmps[j] = np.random.randint(self.dims[j])
            #         self.points[t] = knob2point(tmps, self.dims)
            #         self.visited.add(knob2point(tmps, self.dims))

            # if i >= self.best_iter + early_stopping:
            #     logger.debug("Early stopped. Best iter: %d.", self.best_iter)
            #     break

            if error_ct > 150:
                logging.basicConfig()
                logger.warning("Too many errors happen in the tuning. Now is in debug mode")
                logger.setLevel(logging.DEBUG)
            else:
                logger.setLevel(old_level)
        GLOBAL_SCOPE.in_tuning = False
        del measure_batch
        

